import React from "react";
//Import Components
import Todo from "./Todo";
const TodoList = () => {
    return(
        //Parent component
        <div className="todo-container">
        <ul className="todo-list"></ul>
            <Todo />
            //another component with its own styling
      </div>
    );
};

export default TodoList;
